import React from "react";

function ToDoUpDown() {
    return(
        <>
            <div className="root__container">
                <div className="todo__list">
                    <h2 className="h2__number">0</h2>
                    <div className="todo__up-down">
                        <button>Increm</button>
                        <button></button>
                    </div>
                </div>
            </div>
        </>
    )
}

export default ToDoUpDown;
